package Servlet;

import Model.Customer;

import javax.servlet.ServletException;
import javax.servlet.annotation.WebServlet;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.io.IOException;
import java.util.LinkedList;

@WebServlet(name = "CustomerServlet", urlPatterns = "/customers")
public class CustomerServlet extends HttpServlet {

    public static LinkedList<Customer> linkedList = new LinkedList<Customer>();

    static {
        linkedList.add(new Customer("Mai Văn Hoàn","1983-08-20","Hà Nội","data:image/jpeg;base64,"));
        linkedList.add(new Customer("Hoàn Văn Mai","1983-08-20","Hà Nội","data:image/jpeg;base64,"));
        linkedList.add(new Customer("Văn Mai Hoàn","1983-08-20","Hà Nội","data:image/jpeg;base64,"));
        linkedList.add(new Customer("Mai Hoàn Văn","1983-08-20","Hà Nội","data:image/jpeg;base64,"));
    }

    protected void doPost(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {

    }

    protected void doGet(HttpServletRequest request, HttpServletResponse response) throws ServletException, IOException {
        request.setAttribute("list",linkedList);
        request.getRequestDispatcher("view/customer.jsp").forward(request,response);
    }
}
